import React from 'react';

function AboutMe() {
  return (
    <section>
      <h2>About Me</h2>
      <p>
        Hi, I'm Naail Lakhani, a student at MIT studying Computer Science and
        Engineering. I love game theory, weightlifting, and road trips.
      </p>
    </section>
  );
}

export default AboutMe;
